import React, { Component } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import expenseAction from '../actions/expenseAction'
import getExpensesAction from '../actions/getExpensesAction'


class ExpenseTable extends Component {
    constructor() {
        super()
        this.state = {}
    }

    render(){
      const expense= this.props.expense
        return(   
          <tr>
            <td>{expense.name}</td>
            <td>{expense.date.toLocaleDateString()}</td>
            <td>{expense.amount}</td>
            <td>
                <button className="btn green darken-2 waves-effect waves-light" type="submit" name="action">Edit
                    <i className="material-icons right">edit</i>
                </button>
            </td>
            <td>
                <button className="btn red waves-effect waves-light" type="submit" name="action">Delete
                    <i className="material-icons right">delete_forever</i>
                </button>
            </td>
          </tr>
        )
    }
}

function mapStatetoProps(state) {
  return {
      login: state.login
  }
}
function mapDispatchtoProps(dispatcher) {
  return bindActionCreators({
      getExpensesAction: getExpensesAction
  }, dispatcher)
}


export default connect(mapStatetoProps, mapDispatchtoProps)(ExpenseTable)
